import React from 'react';
import { Box } from '@mui/joy';
import Header from './Header';
import SelectCat from './SelectCat';
import SelectHeigth from './SelectHeigth';
import SelectRad from './SelectRad';
import SelectBranch from './SelectBranch';
import BasicCard from './Cards'
import CustomIcons from './Pagination'
import Footer from './Footer'
import SelectPrice from './SelectPrice'
import { Dropdown } from '@miu';

export default function FormControlLabelPosition() {
  const dropdown = new Dropdown('#my-dropdown');
  dropdown.on('change', () => {
    const input1Value = document.querySelector('#input1').value;
    const input2Value = document.querySelector('#input2').value;
    console.log('Значение Input 1:', input1Value);
    console.log('Значение Input 2:', input2Value);
  });

  return (
    <Box display={'flex'} flexDirection={'column'} alignItems={'center'} marginBottom={'30px'} >
      <Header />
      <Box
        display={'flex'}
        flexDirection={'row'}
        marginTop={'100px'}
        gap={'30px'}
      >
        <SelectCat />
        <SelectHeigth />
        <SelectRad />
        <SelectBranch />
      </Box >
      <Box display={'flex'} flexWrap={'wrap'} gap={'30px'} justifyContent={'center'} marginTop={'30px'}>
      <BasicCard/>
      </Box>
      <CustomIcons sx={{marginTop: '30px'}}/>
      <div id="my-dropdown">
  <input type="number" id="input1" />
  <input type="number" id="input2" />
</div>
      <Footer />
    </Box>
  );
}
